import React from 'react';
import { FaTools, FaCode, FaChartBar, FaDatabase, FaMicrosoft } from 'react-icons/fa';

const skillsData = [
  {
    title: 'Technical Skills',
    icon: <FaChartBar className="text-4xl text-pink-500 mb-4" />,
    items: [
      'Machine Learning',
      'Data Analysis',
      'Tableau',
      'MS Office (Proficient)',
      'SQL',
    ],
  },
  {
    title: 'Programming Languages',
    icon: <FaCode className="text-4xl text-pink-500 mb-4" />,
    items: ['Python', 'C++', 'R', 'HTML', 'JavaScript'],
  },
  {
    title: 'Tools',
    icon: <FaTools className="text-4xl text-pink-500 mb-4" />,
    items: [
      'PostgreSQL',
      'Microsoft Azure',
      'Jupyter Notebook',
      'Docker',
      'GIT/GITHUB',
      'TensorFlow',
      'Selenium',
    ],
  },
  {
    title: 'Excel Skills',
    icon: <FaMicrosoft className="text-4xl text-pink-500 mb-4" />,
    items: [
      'Pivot Tables and Charts',
      'Macro/VBA Automation',
      'Dashboard Creation and Reporting',
      'Power Query/Get and Transform',
    ],
  },
];

const Skills = () => {
  return (
    <div className="bg-gray-900 text-white min-h-screen px-4 py-16">
      <div className="max-w-7xl mx-auto">
        <h2 className="text-4xl font-bold text-center text-pink-500 mb-12">My Skills</h2>

        <div className="grid md:grid-cols-2 lg:grid-cols-2 gap-8">
          {skillsData.map((section, index) => (
            <div
              key={index}
              className="bg-gray-800 rounded-lg p-6 shadow-lg hover:shadow-pink-500/30 transform hover:-translate-y-1 transition-all duration-300"
            >
              <div className="flex flex-col items-center text-center">
                {section.icon}
                <h3 className="text-2xl font-semibold text-white mb-4">{section.title}</h3>
                <ul className="text-gray-300 space-y-2">
                  {section.items.map((skill, idx) => (
                    <li key={idx} className="hover:text-pink-400 transition-colors duration-200">
                      {skill}
                    </li>
                  ))}
                </ul>
              </div>
            </div>
          ))}
        </div>
      </div>
    </div>
  );
};

export default Skills;
